import React, { Component } from "react";

getDefaultState = () => {
  return {
    isRunning: false,
    time: 0
  };
};
class TotalTimer extends Component {
  constructor(props) {
    super(props);
    this.state = getDefaultState();
  }
  render() {
    return (
      <div>
        <h1>Total Timer</h1>
        <h2 className="Number">{this.state.time}</h2>
        <div className="ButtonArea">
          <button className="MainButton">Start</button>
        </div>
      </div>
    );
  }
}

export default TotalTimer;
